// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract LocToken {
  struct Balance {
    uint publicTokens;
    uint privateTokens;
  }
  enum Phase {seedPhase, privatePhase, publicPhase}
  enum Role {owner, privateProvider, publicProvider, user}

  // Адреса
  address public owner;
  address public privateProvider;
  address public publicProvider;
  address public currentTokenOwner;

  // Информация о токене
  uint public total = 10000000;
  uint8 public decimals = 12;
  string public name = "LocalToken";
  string public symbol = "loc";
  uint public phaseTokenLimit = 100000;
  uint public cost = 1 ether * 75 / 100000;

  // Начало системы
  uint public startTime;
  uint public timeDiff;
  Phase public currentPhase = Phase.seedPhase;

  // Пользователи
  mapping (address => Role) public userRoles;
  address[] public users;

  // Whitelist
  mapping (address => bool) public whitelist;
  mapping (address => string) public requests;
  address[] public requestAddresses;

  // Tokens
  mapping (address => uint) public seedTokens;
  mapping (address => uint) public privateTokens;
  mapping (address => uint) public publicTokens;
  mapping (address => uint) public balanceOf;

  // Распоряжение токенами
  mapping (address => mapping (address => uint)) public allows;

  constructor(address _private, address _public, address _investor1, address _investor2, address _friend){
    owner = msg.sender;
    currentTokenOwner = owner;
    privateProvider = _private;
    publicProvider = _public;
    startTime = block.timestamp;
    timeDiff = 0;
    addUser(msg.sender, Role.owner);
    addUser(_private, Role.privateProvider);
    addUser(_public, Role.publicProvider);
    addUser(_investor1, Role.user);
    addUser(_investor2, Role.user);
    addUser(_friend, Role.user);
    balanceOf[owner] += 10000000;
    seedTokens[owner] += 1000000;
    privateTokens[owner] += 3000000;
    publicTokens[owner] += 6000000;
    _transferFrom(owner, _investor1, 300000);
    _transferFrom(owner, _investor2, 400000);
    _transferFrom(owner, _friend, 200000);
  }

  function addUser(address addr, Role role) public {
    userRoles[addr] = role;
    users.push(addr);
  }

  function changeCost(uint amount) public {
    cost = amount;
  }

  //@region Transfers

  function _transferFrom(address from, address to, uint amount) private enoughTokens(from, amount) {
    balanceOf[from] -= amount;
    balanceOf[to] += amount;
    setPhaseHistory(to, amount);
  }

  function transferFrom(address from, address to, uint amount) public enoughTokens(from, amount) {
    allows[from][to] -= amount;
    _transferFrom(from, to, amount);
  }

  function transfer(address to, uint amount) public enoughTokens(msg.sender, amount) {
    _transferFrom(msg.sender, to, amount);
  }

  //@endregion

  function approve(address to, uint amount) public {
    allows[msg.sender][to] += amount;
  }

  function buy(uint amount) public payable checkWhitelist() enoughTokens(currentTokenOwner, amount) checkPhaseLimit(amount) {
    uint sum = amount * cost;
    address payable payableOwner = payable(currentTokenOwner);
    payableOwner.transfer(sum);
    if (sum < msg.value){
      address payable sender = payable(currentTokenOwner);
      payable(sender).transfer(msg.value-sum);
    }
    _transferFrom(currentTokenOwner,msg.sender,amount);
  }

  //@region utils

  function setPhaseHistory(address addr, uint amount) public {
    if (currentPhase == Phase.seedPhase) {
      seedTokens[addr] += amount;
    }
    if (currentPhase == Phase.privatePhase) {
      privateTokens[addr] += amount;
    }
    if (currentPhase == Phase.publicPhase) {
      publicTokens[addr] += amount;
    }
  }

  function timeTravel() public {
    timeDiff++;
  }

  function getTime() public view returns(uint){
    //        return (block.timestamp - startTime)/60 + timeDiff;
    return timeDiff;
  }

  function sendRequest(string memory _name) public {
    require(currentPhase == Phase.seedPhase,"you can send requests only in seed phase");
    requests[msg.sender] = _name;
    bool _inArray = false;
    for (uint8 i = 0; i < requestAddresses.length; i++) {
      if (requestAddresses[i] == msg.sender) {
        _inArray = true;
      }
    }
    if (!_inArray) {
    requestAddresses.push(msg.sender);
    }
  }

  function handleRequest(address sender,bool isAccept) public {
    whitelist[sender] = isAccept;
    requests[sender] = "";
    for (uint8 i = 0; i < requestAddresses.length; i++){
      if (sender == requestAddresses[i]){
        requestAddresses[i] = requestAddresses[requestAddresses.length - 1];
        requestAddresses.pop();
        return;
      }
    }
  }

  function setPrivatePhase() public {
    if (currentPhase == Phase.seedPhase) {
      uint privatePhaseAmount = 3000000;
      currentTokenOwner = privateProvider;
      currentPhase = Phase.privatePhase;
      _transferFrom (owner,privateProvider,privatePhaseAmount);
      phaseTokenLimit = 100000;
    }
  }

  function setPublicPhase() public {
    if (currentPhase == Phase.privatePhase){
      currentTokenOwner = publicProvider;
      uint publicTokenAmount = 6000000;
      _transferFrom(privateProvider,owner,balanceOf[privateProvider]);
      currentTokenOwner = publicProvider;
      currentPhase = Phase.publicPhase;
      _transferFrom(owner,publicProvider,publicTokenAmount);
      cost = 1 ether / 1000;
      phaseTokenLimit = 5000;
    }
  }

  //@endregion

  //@region modifiers

  modifier enoughTokens(address from, uint amount) {
    require(balanceOf[from] >= amount, "check balance");
    _;
  }

  modifier checkWhitelist() {
    require(currentPhase != Phase.seedPhase, "Private sale not started");
    if (currentPhase == Phase.privatePhase) {
      require(whitelist[msg.sender], "Free sale not started");
    }
    _;
  }

  modifier checkPhaseLimit(uint amount) {
    require(amount <= phaseTokenLimit, "value bigger than currentPhaseLimit");
    _;
  }

  //@endregion
}
